import React, { Component } from "react";
import "./Navigation.css";
export class Navigation extends Component {
  state = {
    showHamburger: false
  };
  handleHamburger = e => {
    this.setState({ showHamburger: !showHamburger });
  };
  render() {
    return (
      <div>
        <nav className="menu wow fadeInDown ">
          <a className="logo menu " href="/">
            <i className="far fa-clock"></i>
          </a>

          <ul className="nav  nav-1 menu ">
            <li>
              <a href="/">Home</a>
            </li>
            <li>
              <a href="/">Wacthes</a>
            </li>
          </ul>
          <ul className="nav  nav-2 menu ">
            <li>
              <a href="/">Register</a>
            </li>
            <li>
              <a href="/">Login</a>
            </li>
            <li>
              <a href="/">
                <i className="fas fa-shopping-cart"></i>
              </a>
            </li>
            <li>
              <a href="/">
                <i className="fas fa-search"></i>
              </a>
            </li>
          </ul>
          <div
            className={`hamburger ${
              this.state.showHamburger ? "change" : null
            }`}
            onClick={this.handleHamburger}
          >
            <div className="bar1"></div>
            <div className="bar2"></div>
            <div className="bar3"></div>
          </div>
        </nav>
      </div>
    );
  }
}

// function toggleMenu(x) {
